import AboutMe from "../Pages/AboutMe";
import Projects from "../Pages/Projects";
import {Parallax, ParallaxBanner, useParallax, onProgressChange} from 'react-scroll-parallax'
import '../index.css'
import Navbar from "./Navbar";

const FullpageScroll = () => {
    const parallax = useParallax<HTMLDivElement>({

      });
    return (
        <>     
            <Navbar style = {{marginBottom: '0'}}/>
            <Parallax onProgressChange={(progress) => setProgress(progress)} >
                <img src = "/Images/Subject.png" alt="" style={{marginTop: '0'}}></img>
            </Parallax>
            <Parallax speed={-5} style={{paddingBottom: '800px'}} >
                <Homepage/>
            </Parallax>
            <Parallax speed={5}>
                <AboutMe/>
            </Parallax>
            <Parallax speed={5} style={{paddingTop: '400px'}}>
                <Projects/>
            </Parallax>

        </>
    )
}

export default FullpageScroll
